import './App.css';
import { useState, useEffect } from 'react'
import {getTodos} from './services/getRequests.js'
import Todos from './components/Todos.js'
import {BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom'

function App() {


  return (
    <div className="App">
      <nav className="nav">
        <Link to="/" > Todos </Link>
      </nav>
    <Router >
      <Routes>
        <Route path="/" element={<Todos />}/>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
